import React, { Component } from 'react'
import './styles.css'

export default class Error404 extends Component {
    render() {
        return(
            <article className="Main-container">
                <h1>Error 404: Not Found</h1>
                <h2>Nota. dar estilos a la pagina 404</h2>
            </article>
        )
    }
}
